import { React, Component } from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import Button from "react-bootstrap/Button";
import Container from "react-bootstrap/Container";
import Form from "react-bootstrap/Form";
import Nav from "react-bootstrap/Nav";
import Navbar from "react-bootstrap/Navbar";

//import images1 from "./images/1004.jpg";

//import "./my_css.css";
import { Link } from "react-router-dom";

// import images from "./images/81.jpeg";

function App() {
  return (
    <Navbar bg="light" expand="lg">
      <Container fluid>
        <Navbar.Collapse id="navbarScroll">
          <Nav
            className="me-auto my-2 my-lg-0"
            style={{ maxHeight: "100px" }}
            navbarScroll
          >
            <ul class="navbar-nav">
              <li class="nav-item">
                <img
                  src={images1}
                  alt="My Image"
                  style={{ height: "56px", width: "5rem" }}
                />
              </li>
            </ul>
            <Nav.Link href="/" id="nav">
              Home
            </Nav.Link>
            <Nav.Link href="#action2" id="nav">
              About
            </Nav.Link>
            <Nav.Link href="#action2" id="nav">
              Contact Us
            </Nav.Link>
            <Nav.Link href="/train" id="train">
              TRAIN
            </Nav.Link>
            <Nav.Link href="#action2" id="nav" style={{ color: "#000066" }}>
              REGISTRATION
            </Nav.Link>

            <Button id="login">
              <Link
                to="/login"
                style={{ color: "#ffffff", textDecoration: "none" }}
              >
                Log In
              </Link>
            </Button>
          </Nav>
          <Form className="d-flex">
            <Form.Control
              type="search"
              placeholder="Search"
              className="me-2"
              aria-label="Search"
            />
            <Button id="search" variant="#ff5c3e">
              Search
            </Button>
          </Form>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
}
export default App;
